import styled from 'styled-components'
import banner from './Portfolio_Banner.png';


class Home extends Component {
  render(){
  return (



    <div>
      <h1>Home page/ about</h1>

      < br />

      <BannerContainer className = "first-banner">

      <img src={banner} alt ="Banner" >
      </img>

      </BannerContainer>

      < br />


    </div>

  );
  }
}

export default Home;

const BannerContainer = styled.footer`

.first-banner{
  max-width: 80%;
  height: auto;
}

`
